INSERT INTO `field_revision_body` VALUES ('node','basic_page','0','4','4','und','0','El escultismo (del inglés scouting, que significa explorar) es un movimiento educativo para jóvenes que está presente en 165 países y territorios, con aproximadamente 30 millones de miembros en todo el mundo, agrupados en distintas organizaciones. Las directrices del escultismo fueron dadas por el libro Escultismo para muchachos (1908), del fundador del Movimiento Scout, el británico Robert Stephenson Smyth Lord Baden-Powell of Gilwell en aquel tiempo Coronel hasta 1909 que se le armó caballero y le dieron el título de Sir, pasando a ser Lord Baden-Powell, I barón de Gilwell.\r\nEsta actividad nace como una manera de combatir la delincuencia en la Inglaterra de principios del siglo XX, buscando el desarrollo físico, espiritual y mental de los jóvenes para que puedan constituirse en "buenos ciudadanos". El sistema fue ideado por el propio Baden-Powell y perfeccionado por Vera Barclay y Roland Phillips respectivamente.\r\nEl Movimiento Scout pone énfasis en las actividades lúdicas con objetivos educativos, en las actividades al aire libre y en el servicio comunitario, estos últimas con el objeto de formar el carácter y enseñar de forma práctica valores humanos (contrario a la formación académica teórica, por eso el énfasis en el ejemplo del dirigente). Toma como base de su sistema educativo el "lobatismo" en el caso de los niños (ambiente de familia feliz) y el sistema de patrullas (pequeñas "pandillas" de amigos). A su vez, dependiendo del grupo Scout y la Asociación correspondiente a cada país, existen unidades mayores de jóvenes (Pioneros, Caminantes, Rovers, etc), de niños muy pequeños (Castores, Ardillas) y de niños entre 7 y 11 años (Lobatos).\r\nEn 1907 se realizó el primer campamento experimental en la isla de Brownsea, Bahía de Poole, Dorset, en la costa sur de Inglaterra, en donde participaron 20 muchachos separados en 4 patrullas ("Lobos", "Toros", "Chorlitos" y "Cuervos"), hijos de conocidos militares que hicieron campaña (en África o Asia) con Baden-Powell y de obreros de Londres. Como consecuencia del éxito del nuevo sistema, Baden-Powell escribió un libro donde recopilaba experiencias y anécdotas relacionadas a esta práctica, lo que terminó siendo el ya mencionado Escultismo para muchachos.','','plain_text');
