INSERT INTO `taxonomy_term_data` VALUES ('1','1','General discussion','',null,'0'),('2','3','Rikki Tikki Tavi','Es un personaje del libro de la selva de la rama lobatos.\r\n\r\nEra una mangosta, parecida a un gato pequeño en la piel y la cola, pero mucho más cercana a una comadreja en la cabeza y las costumbres. Los ojos y la punta de su hocico inquieto eran de color rosa; podía rascarse donde quisiera, con cualquier pata, delantera o trasera, que le apeteciera usar; podía inflar la cola hasta que pareciera un cepillo para limpiar botellas, y el grito de guerra que daba cuando iba correteando por las altas hierbas era:\r\n\r\n-¡Rikk-tikk-tikki-tikki-tchk!','plain_text','0'),('3','3','Baloo','Es un personaje del libro de la selva de la rama lobatos.\r\n\r\nEs el oso encargado de transmitir la «Ley de la Selva» a los lobatos del Seeonee (Lugar de desarrollo de la historia) y es en virtud de este papel preponderante que apela a que Mowgli permanezca en la manada cuando Shere Khan acusa a los lobos jovenes para que lo expulsen. Además es el educador de Mowgli. Tanto es el cariño que profesaba Baloo por el niño que es el último animal en abrazar a Mowgli antes que él se vaya de la selva a la manada de los hombres.','plain_text','0'),('4','3','Bagheera','Es un personaje del libro de la selva de la rama lobatos \r\n\r\nEs la pantera negra que salvó la vida de Mowgli, a cambio de un toro recién muerto, que fue entregado a los lobos de Seeone comandados por Akela.\r\nBagheera, aconseja a Mowgli, al igual que Baloo, a sobrevivir en la Selva y a aprovechar los beneficios que esta ofrece, así como a enfrentar los peligros que podrían acechar. Bagheera es siempre respetada por los habitantes de la selva, por ser astuta, sabia y, sobre todo, muy silenciosa y discreta.\r\nEsta pantera es temida por la supersticiosa aldea aledaña a la jungla, por el simple hecho de ser un depredador que varias veces había sido visto cazando y atacando en las cercanías.','plain_text','0'),('5','4','Santa Maria Micaela','','plain_text','0');
INSERT INTO `taxonomy_term_data` VALUES ('6','4','Unidad Educativa del Ejercito','','plain_text','0'),('7','4','San Simon','','plain_text','0'),('8','4','Guadalupano','','plain_text','0'),('10','5','Lobatos','La manada es la "familia feliz" en la que los niños viven sus aventuras. Está formada por niños y niñas entre 7 y 11 años de edad, lobatos. Se les llama lobatos por que se maneja un marco simbólico que es la Fantasía la cual está basada en el Libro de las Tierras Vírgenes (Libro de la selva) donde se relatan las aventuras de Mowgli un niño que fue adoptado por una manada de lobos en la selva del Seeonee, donde conoció a sus amigos la pantera Bagheera, el oso Baloo, la serpiente Kaa, y otros personajes','plain_text','15'),('11','5','Exploradores','Los exploradores son los jóvenes de 11 a 14 años de edad. ','plain_text','16'),('12','5','Pioneros','Los pioneros son los jóvenes de 15 a 17 años de edad.','plain_text','17'),('13','5','Rovers',' Los rovers scouts forman una hermandad en el aire libre y en el servicio. Son excursionistas de los espacios abiertos y acampadores de los bosques, capaces de bastarse a sí mismos, pero al mismo tiempo de servir a los demás. Son de hecho la rama mayor del Movimiento Scout, jóvenes entre los 18 y los 21 años.','plain_text','18'),('14','5','Pata Tierna','A esta etapa pertenecen los lobatos de 7 años','plain_text','0'),('15','5','Saltador','A esta etapa pertenecen los lobatos de 8 años','plain_text','1'),('16','5','Rastreador','A esta etapa pertenecen los lobatos de 9 años','plain_text','2'),('17','5','Cazador','A esta etapa pertenecen los lobatos de 10 años','plain_text','3'),('18','5','Pistas','','plain_text','0'),('19','5','Senda','','plain_text','1'),('20','5','Rumbo','','plain_text','2'),('22','5','Travesia','','plain_text','3'),('23','5','Acogida','','plain_text','1'),('24','5','Compañero','','plain_text','3'),('25','5','Experto','','plain_text','0'),('26','5','Pionero','','plain_text','2'),('27','5','Acogida','','plain_text','2'),('28','5','Aspirante','','plain_text','1'),('29','5','Rover','','plain_text','0');
